INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 1, 1, "リリ", 24001, 40011, 2, 1, 321);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 1, 1, "クリア", 24001, 40011, 2, 2, 322);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "んーと。\nこれ、あげる。\nはい", 126101, 1, 1, "プレシア", 24001, 40011, 2, 3, 323);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 2, 1, "リリ", 24001, 40011, 2, 4, 324);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 2, 1, "クリア", 24001, 40011, 2, 5, 325);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, "お兄。\nきてくれて、うれしい", 126101, 2, 1, "プレシア", 24001, 40011, 2, 6, 326);
